wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(27308887883609363404)
,p_plug_name=>'Termos'
,p_region_template_options=>'#DEFAULT#:t-Region--removeHeader js-removeLandmark:t-Region--scrollBody'
,p_plug_template=>4072358936313175081
,p_plug_display_sequence=>10
,p_location=>null
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
unistr('<div class="ado\00E7\00E3o-termo" style="max-width: 800px; margin: auto; font-family: Arial, sans-serif; font-size: 14px; line-height: 1.6;">'),
unistr('  <h2 style="text-align: center;">TERMOS DE COMPROMISSO DE ADO\00C7\00C3O<br>CACHORREIROS E GATEIROS</h2>'),
'',
unistr('  <p>Esse formul\00E1rio tem como objetivo conhecer melhor os poss\00EDveis adotantes.</p>'),
'',
unistr('  <p>Como protetores, a escolha de um adotante \00E9 muito complicada e de uma responsabilidade imensa.</p>'),
'',
unistr('  <p>Resgatar uma vida n\00E3o \00E9 f\00E1cil, e n\00F3s que desenvolvemos um la\00E7o muito grande com o animal, precisamos saber como ele est\00E1.</p>'),
'',
unistr('  <p>O question\00E1rio n\00E3o \00E9 "desnecess\00E1rio" ou "burocracia" demais, \00E9 apenas a nossa seguran\00E7a, para que eles, que j\00E1 sofreram tanto, tenham todo o apoio e amor que merecem.</p>'),
'',
unistr('  <p>Responda com sinceridade e assim que poss\00EDvel entraremos em contato!</p>'),
'',
unistr('  <h3>NOSSAS CONDI\00C7\00D5ES PARA REALIZAR A ADO\00C7\00C3O:</h3>'),
'',
'  <ol>',
unistr('    <li>Entender que animais fazem bagun\00E7a, quebram coisas e fazem suas necessidades no lugar errado de vez em quando.</li>'),
unistr('    <li>Ser <strong>a favor</strong> da castra\00E7\00E3o, vacina\00E7\00E3o e no caso dos gatos, estar ciente sobre a FIV/FELV e a import\00E2ncia da testagem.</li>'),
unistr('    <li>Se existir algum outro animal na resid\00EAncia, ele precisa estar obrigatoriamente castrado, vacinado e desverminado (ou testado, no caso dos gatos).</li>'),
unistr('    <li>No caso dos filhotes, entender que <strong>N\00C3O PODEMOS GARANTIR O PORTE</strong>. Se tu queres um determinado porte, <strong>ADOTE UM ADULTO!</strong> Eles tamb\00E9m merecem uma chance. Filhotes crescem e exigem muito mais aten\00E7\00E3o do que adultos')
||'.</li>',
unistr('    <li>Para a ado\00E7\00E3o de <strong>gatos</strong>, a casa precisa ser 100% <strong>telada</strong>! N\00E3o adianta dizer que tem "vidros" ou que sempre mant\00E9m tudo fechado, precisa ser tudo totalmente telado para a seguran\00E7a dos gatinhos. <strong>Voltinha')
||unistr('s s\00F3 na coleira!</strong></li>'),
unistr('    <li>Fotos do p\00E1tio e de todas as telas s\00E3o de extrema import\00E2ncia. Se quiser agilizar o processo, j\00E1 pode encaminhar as fotos para o n\00FAmero do WhatsApp do protetor(a) que voc\00EA fez contato.</li>'),
unistr('    <li>Proporcionar alimenta\00E7\00E3o de qualidade e todos os cuidados que o animal necessita.</li>'),
unistr('    <li>Concordar que a qualquer momento que a ONG julgue necess\00E1rio, se o adotante <strong>n\00E3o</strong> estiver realizando as normas solicitadas no termo de ado\00E7\00E3o, a guarda do animal voltar\00E1 para a ONG e o mesmo ser\00E1 retirado do adotante.</li>'),
unistr('    <li>Concordar que o animal <strong>jamais poder\00E1 ser doado</strong> para outra pessoa. Em qualquer situa\00E7\00E3o que isso seja uma possibilidade, a ONG \00E9 quem ir\00E1 recolher novamente o animal.</li>'),
'  </ol>',
'',
unistr('  <p>Adotar um animalzinho exige <strong>responsabilidade</strong> e <strong>paci\00EAncia</strong>. N\00E3o tome essa decis\00E3o apenas por impulso, \00E9 algo que precisa ser <strong>bem pensado</strong> e planejado. \00C9 uma <strong>VIDA</strong> que est\00E1 em jogo.<')
||'/p>',
'',
unistr('  <p>N\00E3o adote s\00F3 porque est\00E1 se sentindo sozinho. Pense na sua rotina normal, pense em quantas horas o animal ficar\00E1 sozinho (ele pode ficar depressivo se estiver muito tempo sozinho) e se voc\00EA tem condi\00E7\00F5es de arcar com todos os custos necess\00E1rios ')
||unistr('(vacina\00E7\00E3o, consultas no veterin\00E1rio, castra\00E7\00E3o, etc).</p>'),
'',
unistr('  <p><strong>Qualquer d\00FAvida \00E9 s\00F3 chamar!</strong></p>'),
'',
unistr('  <p style="margin-top: 30px;"><strong>MALTRATAR OS ANIMAIS \00C9 CRIME</strong> CONFORME A <strong>LEI SANS\00C3O</strong> (Lei n\00B0 14.064/2020 \2013 Pena de dois a cinco anos para quem maltratar c\00E3o ou gato).</p>'),
'',
unistr('  <p><strong>N\00D3S ESTAREMOS DE OLHO SEMPRE!!</strong></p>'),
'</div>',
''))
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
  'expand_shortcuts', 'N',
  'output_as', 'HTML')).to_clob
);
